script: |
  super -f text -I q405.spq | sort > q405.out

inputs:
  - name: q405.spq
    data: |
      SELECT 46 AS col2 FROM tab0 (FORMAT parquet) WHERE ( + col2 + + col0 ) NOT BETWEEN ( col0 * CAST ( 96 / col0 AS INTEGER ) ) AND + col2;
  - name: tab0

outputs:
  - name: q405.out
    data: |
      46
      46
      46
